    function mudarValor(evento){
        SetValor(!valor)
        console.log(valor)
    }
    return (
        <div className='geral'>
            <div className="form-check form-switch">
                <input className="form-check-input" checked={valor} onChange={mudarValor} type="checkbox" id="flexSwitchCheckDefault" />
                <label className="form-check-label" htmlFor="flexSwitchCheckDefault">{texto}</label>
            </div>
        </div>
    )
}

export default Check
